import Link from "next/link";
import { Navbar, Row, Col, Nav } from "react-bootstrap";
import styles from "./AppNavBar.module.css";

const AppNavbar = () => {
  return (
    <Navbar
      bg="transparent"
      variant="dark"
      className="d-flex justify-content-center my-5"
      style={{ zIndex: 10 }}
    >
      <Nav className="mx-3">
        <Nav.Item>
          <Link href="/">
            <a className={styles.links}>Breaking Bad</a>
          </Link>
        </Nav.Item>
      </Nav>
      <Navbar.Brand href="/" className="mr-0">
        <img alt="" src="/logo.png" className={styles.logo} />
      </Navbar.Brand>
      <Nav className="mx-3">
        <Nav.Item>
          <Link href="/spinoff">
            <a className={styles.links}>Better Call Saul</a>
          </Link>
        </Nav.Item>
      </Nav>
    </Navbar>
  );
};

export default AppNavbar;
